def nx_draw(nodelist, coordinate, edges, center_points,final_set_label,R):

    fig = plt.figure(figsize=(5, 5))
    G = nx.Graph()
    # nx.draw_random(G)

    pos = dict(zip(nodelist, coordinate))
    labels = dict(zip(nodelist, nodelist))
    # 1E90FF

    nx.draw_networkx_nodes(G, pos, nodelist, node_size=5, node_color='r',label="POI")
    nx.draw_networkx_nodes(G, {0: [0, 0]}, {0: 0}, node_size=100, node_color='#556B2F',node_shape='^',label="base")


    # nx.draw(G, pos=nx.random_layout(G), with_labels=True)

    for i in final_set_label:
        # 参数设置
        x = center_points[i][0]  # 圆心的x轴坐标
        y = center_points[i][1]  # 圆心的y轴坐标
        r = R  # 圆的半径
        # 画圆
        # fig = plt.figure(figsize=(5, 5))
        circle = plt.Circle((x, y), r, color='#87CEFA', fill=False)
        plt.gcf().gca().add_artist(circle)

     #FE4365
    nx.draw_networkx_edges(G, center_points, edges[0],edge_color='#DB7093',label="UAV1")
    nx.draw_networkx_edges(G, center_points, edges[1],edge_color='#000000',label="UAV2")
    nx.draw_networkx_edges(G, center_points, edges[2],edge_color='#2E8B57',label="UAV3")
    nx.draw_networkx_edges(G, center_points, edges[3],edge_color='#FF8C00',label="UAV4")
    nx.draw_networkx_edges(G, center_points, edges[4], edge_color='#A0522D', label="UAV5")
    # if Label:
    #     nx.draw_networkx_labels(G, pos, labels, font_size=8)

    # plt.title()默认是显示英文,加以下两行可显示中文
    # 解决中文显示问题
    plt.rcParams['font.sans-serif'] = ['SimHei']
    plt.rcParams['axes.unicode_minus'] = False


    n = len(nodelist)-1
    # plt.title('网格d=1 半径R=%d'%R)
    # plt.show() # 当要保存pdf时请注释掉这句，否则会输出空白


    num1 = 1.05
    num2 = 0
    num3 = 3
    num4 = 0
    plt.legend(bbox_to_anchor=(num1, num2), loc=num3, borderaxespad=num4,fontsize=15)  # 让图例生效
    s = "./tcsPic/"
    plt.savefig(s + 'showPath' + '-' + 'R='+str(R) +'d=2'+ '.pdf',dpi=1000, format='pdf',bbox_inches="tight")



